import React from 'react';
import { Button, Link } from '@material-ui/core';

import { NextLink } from './NextLink'

export const DesktopMenu = ({ list }) => {
  return (
    <div>
      {list.map(item => (
        <NextLink href={item.href}>
          <Link color="inherit">{item.title}</Link>
        </NextLink>
      ))}
    </div>
  );
};
